import React from 'react';
import './App.css';

const App = () => {
  return (
    <>
      <div className='div'>
          <div className='div1'>
          <h1>0</h1>
            <button>Increase</button> 
            <button>Decrease</button>
          </div>
      </div>
    </>
  )
}

export default App
